async function fetchExpenses() {
    try {
        const response = await fetch(API_URL);
        if (!response.ok) throw new Error("Failed to fetch expenses");
        return await response.json();
    } catch (error) {
        console.error("Error fetching expenses:", error);
        return [];
    }
}

// Populate the Month Dropdown
function populateMonthDropdown() {
    const monthDropdown = document.getElementById("exportMonth");
    monthDropdown.innerHTML = ""; // Clear existing options

    for (let i = 0; i < 12; i++) {
        let option = document.createElement("option");
        option.value = i;
        option.textContent = new Date(2000, i).toLocaleString('default', { month: 'long' }); // Get month name
        monthDropdown.appendChild(option);
    }
}

// Show Export Popup
function showExportPopup() {
    populateMonthDropdown(); // Ensure dropdown is populated
    document.getElementById("popupOverlay").style.display = "block";
    document.getElementById("exportPopup").style.display = "block";
}

// Close Export Popup
function closeExportPopup() {
    document.getElementById("popupOverlay").style.display = "none";
    document.getElementById("exportPopup").style.display = "none";
}

// Export PDF Function
async function exportToPDF() {
    const { jsPDF } = window.jspdf;

    const selectedMonth = parseInt(document.getElementById("exportMonth").value);
    const year = new Date().getFullYear();
    const expenses = await fetchExpenses();

    const filteredExpenses = expenses.filter(exp => {
        let expDate = new Date(exp.date);
        return expDate.getFullYear() === year && expDate.getMonth() === selectedMonth;
    });

    if (filteredExpenses.length === 0) {
        alert("No expenses found for the selected month.");
        return;
    }

    const totalAmount = filteredExpenses.reduce((sum, exp) => sum + exp.amount, 0);
    const doc = new jsPDF();

    // âœ… Base64 Encoded Image for Logo
    const logoBase64 = " data:image/png;base64, "; 

    doc.addImage(logoBase64, 'PNG', 10, 10, 30, 30);
    generatePDF(doc, filteredExpenses, selectedMonth, year, totalAmount);
}


// Helper function to generate the PDF content
function generatePDF(doc, filteredExpenses, selectedMonth, year, totalAmount) {
    // Title
    doc.setFont("helvetica", "bold");
    doc.setFontSize(18);
    doc.text("Expense Report", 80, 20);
    doc.setFontSize(12);
    doc.text(`Month: ${new Date(2000, selectedMonth).toLocaleString('default', { month: 'long' })}, Year: ${year}`, 80, 30);

    // Expense Table Data
    const tableData = filteredExpenses.map(exp => [
        new Date(exp.date).toLocaleDateString(), 
        exp.category, 
        `â‚¹${exp.amount.toFixed(2)}`
    ]);

    // Create Modern Table
    doc.autoTable({
        head: [['Date', 'Category', 'Amount']],
        body: tableData,
        startY: 40,
        theme: 'grid',
        styles: {
            fontSize: 10,
            cellPadding: 5,
            valign: 'middle',
            halign: 'center',
            fillColor: [240, 240, 240],
        },
        headStyles: {
            fillColor: [52, 58, 64], // Dark Gray Header
            textColor: [255, 255, 255], // White Text
            fontStyle: 'bold',
        },
        alternateRowStyles: {
            fillColor: [250, 250, 250], // Light Gray for Alternate Rows
        },
    });

    // Add Total Amount at the Bottom
    let finalY = doc.autoTable.previous.finalY + 10;
    doc.setFontSize(12);
    doc.setFont("helvetica", "bold");
    doc.text(`Total Amount Spent: â‚¹${totalAmount.toFixed(2)}`, 80, finalY);

    // Add Disclaimer at the Bottom
    finalY += 10;
    doc.setFontSize(10);
    doc.setFont("helvetica", "italic");
    doc.setTextColor(150, 150, 150);
    doc.text("This is a computer-generated report. No signature required.", 50, finalY);

    // Save PDF
    doc.save(`Expense_Report_${year}_${selectedMonth + 1}.pdf`);

    // Close Popup
    closeExportPopup();
}


//calender
let currentYear = new Date().getFullYear();
let currentMonth = new Date().getMonth();

async function fetchExpenses() {
    try {
        const response = await fetch(API_URL);
        if (!response.ok) throw new Error("Failed to fetch expenses");
        return await response.json(); // Assuming API returns an array of expenses
    } catch (error) {
        console.error("Error fetching expenses:", error);
        return [];
    }
}

async function loadCalendarWithExpenses(year, month) {
    const expenses = await fetchExpenses();
    const calendarDiv = document.getElementById("calendarDisplay");
    if (!calendarDiv) {
        console.error("Error: #calendarDisplay not found.");
        return;
    }

    const firstDay = new Date(year, month, 1).getDay();
    const lastDate = new Date(year, month + 1, 0).getDate();
    
    let calendarHTML = `
        <div class="calendar-header">
            <select id="monthSelect" onchange="updateCalendar()">
                ${Array.from({ length: 12 }, (_, i) => 
                    `<option value="${i}" ${i === month ? 'selected' : ''}>${new Date(2000, i).toLocaleString('default', { month: 'long' })}</option>`).join('')}
            </select>
            <select id="yearSelect" onchange="updateCalendar()">
                ${Array.from({ length: 10 }, (_, i) => {
                    let y = currentYear - 5 + i;
                    return `<option value="${y}" ${y === year ? 'selected' : ''}>${y}</option>`;
                }).join('')}
            </select>
        </div>
        <table class="table calendar-table">
            <tr>${["Sun", "Mon", "Tue", "Wed", "Thu", "Fri", "Sat"].map(day => `<th>${day}</th>`).join("")}</tr>
            <tr>
    `;

    const expenseMap = {};
    expenses.forEach(expense => {
        let expenseDate = new Date(expense.date);
        if (expenseDate.getFullYear() === year && expenseDate.getMonth() === month) {
            let day = expenseDate.getDate();
            expenseMap[day] = (expenseMap[day] || 0) + expense.amount;
        }
    });

    for (let i = 0; i < firstDay; i++) calendarHTML += "<td></td>";

    for (let day = 1; day <= lastDate; day++) {
        calendarHTML += expenseMap[day] ? `
            <td class="expense-day" title="Total: â‚¹${expenseMap[day]}">
                <div class="day-content">${day}<span class="dot"></span><span class="amount">â‚¹${expenseMap[day]}</span></div>
            </td>` : `<td>${day}</td>`;

        if ((day + firstDay) % 7 === 0) calendarHTML += "</tr><tr>";
    }
    calendarHTML += "</tr></table>";
    calendarDiv.innerHTML = calendarHTML;
}

function updateCalendar() {
    let selectedMonth = parseInt(document.getElementById("monthSelect").value);
    let selectedYear = parseInt(document.getElementById("yearSelect").value);
    loadCalendarWithExpenses(selectedYear, selectedMonth);
}

// Load the calendar when the page loads
document.addEventListener("DOMContentLoaded", () => loadCalendarWithExpenses(currentYear, currentMonth));



