//expenses
async function loadExpenses() {
    try {
        const response = await fetch(`${API_URL}`);
        const expenses = await response.json();

        const tableBody = document.getElementById("expenseHistoryTable");
        tableBody.innerHTML = "";

        expenses.forEach(expense => {
            const row = document.createElement("tr");

            // Parse date properly
            const dateObj = new Date(expense.date);
            const formattedDate = dateObj.toISOString().split('T')[0]; // YYYY-MM-DD

            // Time is already stored as HH:mm:ss string, use it directly
            const formattedTime = expense.time || "N/A"; // Use "N/A" if time is missing

            row.innerHTML = `
                <td>${formattedDate}</td>
                <td>${formattedTime}</td> <!-- Display Correct Time -->
                <td>${expense.title}</td>
                <td>${expense.amount}</td>
                <td>${expense.category}</td>
                <td>
                    <button class="btn btn-danger" onclick="deleteExpense('${expense.id}')">Delete</button>
                </td>
            `;
            tableBody.appendChild(row);
        });
    } catch (error) {
        console.error("Error loading expenses:", error);
    }
}


// Load Expenses
document.getElementById("expenseForm").addEventListener("submit", async function (e) {
    e.preventDefault();

    // Get input values
    const title = document.getElementById("title").value.trim();
    const amount = parseFloat(document.getElementById("amount").value);
    const category = document.getElementById("category").value;
    const date = new Date().toISOString(); // Ensure proper date format

    // Validate input
    if (!title || isNaN(amount) || amount <= 0 || !category) {
        showAlert("Please enter valid expense details.", "danger");
        return;
    }

    try {
        // Send request to API
        const response = await fetch(API_URL, {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify({ title, amount, category, date })
        });

        if (!response.ok) {
            throw new Error(`Failed to add expense. Server responded with ${response.status}`);
        }

        // Reset form after successful submission
        document.getElementById("expenseForm").reset();

        // Reload expenses
        await loadExpenses();

        // Show success message
        showAlert("Expense added successfully!", "success");
    } catch (error) {
        console.error("Error adding expense:", error);
        showAlert("Error adding expense. Please try again.", "danger");
    }
});


// Delete Single Expense
async function deleteExpense(expenseId) {
    try {
        const response = await fetch(`${API_URL}/${expenseId}`, { method: "DELETE" });
        if (!response.ok) throw new Error("Failed to delete expense.");

        await loadExpenses();
        showAlert("Expense deleted successfully!", "success");
    } catch (error) {
        console.error("Error deleting expense:", error);
        showAlert("Error deleting expense. Please try again.", "danger");
    }
}
function showAlert(message, type) {
    // Remove existing alert if any
    const existingAlert = document.getElementById("customAlert");
    if (existingAlert) {
        existingAlert.remove();
    }

    // Create the alert element
    const alertBox = document.createElement("div");
    alertBox.id = "customAlert";
    alertBox.className = "alert alert-dismissible fade show";
    
    // Apply styles for positioning, color, and appearance
    alertBox.style.cssText = `
        position: fixed;
        top: 15%;
        left: 50%;
        transform: translate(-50%, -50%);
        min-width: 300px;
        max-width: 400px;
        text-align: center;
        z-index: 1050;
        padding: 15px;
        border-radius: 8px;
        box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.2);
        background-color: #17a2b8; /* Custom Color */
        color: white;
        font-weight: bold;
        opacity: 1;
        transition: opacity 0.5s ease-in-out;
    `;

    alertBox.innerHTML = `${message}`; // Only message, no close button

    // Append to body
    document.body.appendChild(alertBox);

    // Auto-remove after 3 seconds
    setTimeout(() => {
        alertBox.style.opacity = "0";
        setTimeout(() => alertBox.remove(), 200); // Extra delay for smooth fade out
    }, 1000);
}




